/**
 * Created by AneeqShah on 2/26/19.
 */

import React from 'react';
import './Pagination.css';

const Pagination = (props) => {

    const {page, totalPages, handlePaginationClick} = props;

    return(
        <div className="Pagination">
            <button className="Pagination-button" onclick={() => handlePaginationClick}>&larr;</button>
            <span className="Pagination-info">Page <b>{page}</b> of <b>{totalPages}</b></span>
            <button className="Pagination-button" onClick={handlePaginationClick.bind(this, 'next')}>&rarr;</button>


        </div>
    );
};

export default Pagination;
